package io.spring.core.user;

import org.junit.jupiter.api.Test;
import org.junit.jupiter.api.BeforeEach;
import org.junit.jupiter.api.DisplayName;
import java.time.LocalDate;
import static org.junit.jupiter.api.Assertions.*;
class UserTest {

    private User instance;

    @BeforeEach
    void setUp() {
        instance = new User();
    }

        @Test
        @DisplayName("Updates user fields when provided with non-empty strings")
        void testUpdateWithValidInputs() {
            instance.update("newemail@example.com", "newuser", "newpass", "new bio", "newimage");
        }

        @Test
        @DisplayName("Does not update fields when inputs are null")
        void testUpdateWithNullInputs() {
            instance.update(null, null, null, null, null);
        }

        @Test
        @DisplayName("Does not update fields when inputs are empty strings")
        void testUpdateWithEmptyStrings() {
            instance.update("", "", "", "", "");
        }

}
